import React from "react";
import cls from './index.module.scss'

const Input = ( { placeholder,onBlur,value, type} ) => {

  return (
    <input 
      className={cls.input} 
      placeholder={placeholder} 
      value={value}
      onBlur={onBlur}
      type = {type}
    />        
  )
}

export default Input
